import{_ as b,a as y}from"./Footer-371a5778.js";import{_ as k}from"./Top-6d240367.js";import{_,a as s,c as e,h as d,u as x,e as N,g as r,b as p,w as n,t as v,F as m,d as V,f as u,i as g,j as i,k as w}from"./index-4cd145f3.js";const B=""+new URL("logo-big-260f4de8.png",import.meta.url).href;const C={},I={class:"container-intro"},R=d('<h2 class="title">基金会介绍</h2><div class="part1"><div class="logo"><img src="'+B+'"></div><div class="intro"><p class="detail">浙江中有慈善基金会（简称“中有善金”）成立于2022年11月3日，注册资金200万元。中有基金是浙江省民政厅批准成立的慈善组织，业务主管单位为浙江省民政厅。</p><p class="detail">中有基金在公益项目募捐、项目执行等方面制定了完善的规章制度，每年邀请第三方会计师事务所做财务审计和专项审计。聘请专业财务顾问公司和专业法律顾问。</p><p class="detail">中有善金按要求对基金会章程、基金会制度、年度工作报告、项目募捐、项目执行和财务审计等情况进行全面的信息披露。中有基金发扬传统公益慈善精神，为社会弱势群体，尤其是孤、苦、老、弱、贫、病人群提供帮助和扶持。中有基金的核心理念是：善心居中，善施为有。</p></div></div><div class="part2"><div class="cerfi"></div></div>',3),z=[R];function O(t,a){return s(),e("div",I,z)}const P=_(C,[["render",O]]);const S={},j={class:"container-rules"},A=d('<h2 class="title">浙江中有慈善基金会章程</h2><div><p class="rules-para">第一章 总 则 </p><p class="rules"><strong>第一条</strong> 本基金会的名称是浙江中有慈善基金会。 </p><p class="rules"><strong>第二条</strong> 本基金会属于非公募基金会。 </p><p class="rules"><strong>第三条</strong> 本基金会遵守宪法、法律、法规和国家政策，践行社会主义核心价值观，遵守社会道德风尚。 </p><p class="rules">本基金会的宗旨遵守宪法，法律法规和国家政策，遵守社会道德风尚，促进慈善事业发展，积极行善，关爱社会，通过慈善基金会，为需要帮助的人和群体提供慈善资助服务。 </p><p class="rules"><strong>第四条</strong> 本基金会的原始基金数额为人民币贰佰万元，来源于杭州千岛湖水茶人生新农业科技有限公司。 </p><p class="rules"><strong>第五条</strong> 本基金会坚持中国共产党的全面领导，根据中国共产党章程的规定，建立中国共产党的组织开展党的活动，为党组织的活动提供必要条件。 </p><p class="rules">本基金会的登记管理机关是浙江省民政厅，党建工作机构是中共杭州市余杭区五常街道工作委员会。</p><p class="rules">本基金会接受党建工作机构、登记管理机关和有关业务管理部门的业务指导和监督管理。 </p><p class="rules"><strong>第六条</strong> 本基金会的住所:杭州市余杭区五常街道联创街133号2幢601、602、603、604、605、606、607室。 </p><p class="rules-para">第二章 业务范围</p><p class="rules"><strong>第七条</strong> 本基金会公益活动的业务范围:</p><p class="rules">(一) 积极扶助需要资助的农村、城镇老弱病残和弱势群体。</p><p class="rules">(二) 参与扶贫工作，支持社会公益设施的建设。 </p><p class="rules">(三) 为需要资助的学龄儿童、青少年提供支持。 </p><p class="rules">(四) 发生地震、洪水、暴雪等自然灾害和社会突发事件与灾难时，为处于困境的人民群众提供救助。 </p><p class="rules-para">第三章 组织机构、负责人 </p><p class="rules"><strong>第八条</strong> 本基金会由5名理事组成理事会。本基金会理事每届任期为5年，任期届满连选可以连任。 </p><p class="rules"><strong>第九条</strong> 理事的资格: </p><p class="rules">(一) 县有完全民事行为能力；</p><p class="rules">(二) 热心基金会所从事的公益事业；</p><p class="rules">(三) 具有与业务工作相适应的工作阅历和工作经验；</p><p class="rules">(四) 能够尽职尽责，保障捐赠财产的使用符合捐赠人的意愿和基金会的公益目的，努力保障基金会财产的安全及保值增值；</p><p class="rules">(五) 廉洁奉公、诚信正直。</p><p class="rules"><strong>第十条</strong> 理事的产生和罢免:</p><p class="rules">(一) 第一届理事由主要捐赠人、发起人分别提名并共同协商确定。</p><p class="rules">(二) 理事会换届改选时，由理事会、基金会党组织、主要捐赠人共同提名候选人并组织换届领导小组组织全部候选人共同选举产生新一届理事。</p><p class="rules">(三) 罢免、增补理事应当经理事会表决通过，报党建工作机构审查同意；</p><p class="rules">(四) 理事的选举和罢免结果报登记管理机关备案；</p><p class="rules">(五) 具有近亲属关系的不得同时在理事会任职。</p><p class="rules"><strong>第十一条</strong> 理事的权利和义务:</p><p class="rules">(一) 在理事会会议上充分发表意见，对表决事项行使表决权；</p><p class="rules">(二) 查阅理事会记录和本基金会财务会计报告，提出质询并要求说明；</p><p class="rules">(三) 调本基金会档案约本金会工作人员了解情况查询或调查本基金会的专项工作；</p><p class="rules">(四) 提议召开临时会议或特别会议；</p><p class="rules">(五) 遵守基金会章程，贯彻基金会宗旨，遵从理事会做出的决定，忠实履行职责，维护本基金会及理事会的利益，不得利用在本基金会的职权为自己谋取私利，不得侵占、挪用本基金会财产，不得从事损害本基金会利益的活动；</p><p class="rules">(六) 细阅读本基金会的财务报告，谨决策重大业务活动计划，积极为本基金会的发展提出意见和建议。</p><p class="rules"><strong>第十二条</strong> 本基金会的决策机构是理事会。理事会行使下列职权</p><p class="rules">(一) 制定、修改章程；</p><p class="rules">(二) 选举、罢免理事长、副理事长、秘书长；</p><p class="rules">(三) 决定重大业务活动计划，包括资金的募集、管理和使用计划；</p><p class="rules">(四) 年度收支预算及决算审定；</p><p class="rules">(五) 制定内部管理制度；</p><p class="rules">(六) 决定设立办事机构、分支机构、代表机构； </p><p class="rules">(七) 决定由秘书长提名的副秘书长和各机构主要负责人的聘任；</p><p class="rules">(八) 取、审议秘书长的工作报告，检查秘书长的工作； </p><p class="rules">(九) 决定基金会的分立、合并或终止； </p><p class="rules">(十) 决定其他重大事项。 </p><p class="rules"><strong>第十三条</strong> 事会每年召开2次会议。理事会会议由理事长负责召集和主持。 有1/3理事提议，必须召开理事会会议。如理事长不能召集，提议理事可推选召集人。召开理事会会议，理事长或召集人需提前5日通知全体理事、监事。 </p><p class="rules"><strong>第十四条</strong> 理事会会议须有2/3以上理事出席方能召开；理事会决议须经出席理事过半数通过方为有效。 </p><p class="rules">下列重要事项的决议，须经出席理事表决，2/3以上通过方为有效: </p><p class="rules">(一) 章程的修改 </p><p class="rules">(二) 选举或者罢免理事长、副理事长、秘书长；</p><p class="rules">(三) 章程规定的重大募捐、投资活动；</p><p class="rules">(四) 基金会的分立、合并； </p><p class="rules"><strong>第十五条</strong> 理事会会议应当制作会议记录。形成决议的，应当当场制作会议纪要，并由出席理事审阅，签名。</p><p class="rules">理事会决议违反法律、法规或章程规定，致使基金会遭受损失的，参与决议的理事应当承担责任。但经证明在表决时反对并记载于会议记录的，该理事可免除责任。 </p><p class="rules"><strong>第十六条</strong> 本基金会设监事1名，监事任期与理事任期相同，期满可以连任。 </p><p class="rules"><strong>第十七条</strong> 理事、理事的近亲属和基金会财会人员不得任监事。 </p><p class="rules"><strong>第十八条</strong> 监事的产生和罢免:</p><p class="rules">(一) 监事由主要捐赠人选派； </p><p class="rules">(二) 登记管理机关根据工作需要选派: </p><p class="rules">(三) 监事的变更依照其产生程序 </p><p class="rules"><strong>第十九条</strong> 监事的权利和义务: </p><p class="rules">监事依照章程规定的程序检查基金会财务和会计资料，监督理事会遵守法律和章程的情况。 </p><p class="rules">监事列席理事会会议有权向理事会提出质询和建议，并应当向登记管理机关、党建工作机构以及税务、会计主管部门反映情况。 </p><p class="rules">监事应当遵守有关法律法规和基金会章程，忠实履行职责。</p><p class="rules"><strong>第二十条</strong> 在本基金会领取报酬的理事不得超过理事总人数的1/3。</p><p class="rules">监事和未在基金会担任专职工作的理事不得从基金会获取报酬。 </p><p class="rules"><strong>第二十一条</strong> 本基金会理事遇有个人利益与基金会利益关联时，不得参与相关事宜的决策:</p><p class="rules">基金会理事、监事及其近亲属不得与基金会有任何交易行为。 </p><p class="rules"><strong>第二十二条</strong> 理事会设理事长、副理事长和秘书长，从理事中选举产生。 </p><p class="rules"><strong>第二十三条</strong> 本基金会理事长、副理事长、秘书长必须符合以下条件:</p><p class="rules">(一) 在本基金会业务领域内有较大影响； </p><p class="rules">(二) 身体健康，能坚持正常工作； </p><p class="rules">(三) 具有完全民事行为能力。 </p><p class="rules"><strong>第二十四条</strong> 有下列情形之一的人员，不能担任本基金会的理事长、副理事长、秘书长: </p><p class="rules">(一) 属于现职国家工作人员的； </p><p class="rules">(二) 因犯罪被判处管制、拘役或者有期徒刑，刑期执行完毕之日起未逾5年的； </p><p class="rules">(三) 因犯罪被判处剥夺政治权利正在执行期间或者曾经被判处剥夺政治权利的； </p><p class="rules">(四) 曾在因违法被撤销登记的基金会担任理事长、副理事长或者秘书长，且对该基金会的违法行为负有个人责任，自该基金会被撤销之日起未逾5年的。 </p><p class="rules"><strong>第二十五条</strong> 本基金会的理事长、副理事长、秘书长每届任期5年，连任不超过两届。因特殊情况需超届连任的，须经理事会特殊程序表决通过，报党建工作机构审查并经登记管理机关批准同意后，方可任职。</p><p class="rules"><strong>第二十六条</strong> 本基金会理事长为基金会法定代表人。</p><p class="rules">本基金会法定代表人不兼任其他组织的法定代表人。 </p><p class="rules">本基金会法定代表人应当由中国内地居民担任。 </p><p class="rules">本基金会法定代表人在任期间，基金会发生违反《基金会管理条例》和本章程的行为，法定代表人应当承担相关责任。因法定代表人失职，导致基金会发生违法行为或基金会财产损失的，法定代表人应当承担个人责任。 </p><p class="rules"><strong>第二十七条</strong> 本基金会理事长行使下列职权: </p><p class="rules">(一) 召集和主持理事会会议 </p><p class="rules">(二) 检查理事会决议的落实情况 </p><p class="rules">(三) 代金签重要文件</p><p class="rules">本基金会副理事长、秘书长在理事长领导下开展工作，秘书长行使下列职权: </p><p class="rules">(一) 主持开展日常工作，组织实施理事会决议；</p><p class="rules">(二) 组织实施基金会年度公益活动计划；</p><p class="rules">(三) 拟订资金的筹集、管理和使用计划；</p><p class="rules">(四) 拟订基金会的内部管理规章制度，报理事会审批。 </p><p class="rules-para">第四章 财产的管理和使用 </p><p class="rules"><strong>第二十八条</strong> 本基金会为非公募基金会，本基金会的收入来源于：</p><p class="rules">(一) 杭州千岛湖水茶人生新农业科技有限公司贰佰万元人民币的捐赠；</p><p class="rules">(二) 自然人、法人或其他组织自愿捐赠；</p><p class="rules">(三) 投资收益； (四) 其他合法收入等。 </p><p class="rules"><strong>第二十九条</strong> 本基金会接受捐赠，应当遵守法律法规，符合章程规定的宗旨和公益活动的业务范围。 </p><p class="rules"><strong>第三十条</strong> 本基金会的财产及其他收入受法律保护，任何单位、个人不得侵占、私分、挪用。</p><p class="rules">本基金会投入人对投入基金会的财产不保留或享有任何财产权利。基金会财产及孳息不得用于分配。 </p><p class="rules"><strong>第三十一条</strong> 本基金会根据章程规定的宗旨和公益活动的业务范围使用财产:</p><p class="rules">捐赠协议明确了具体使用方式的捐赠，根据捐赠协议的约定使用。 接受捐赠的物资无法用于符合本基金会宗旨的用途时，基金会可以依法拍卖或者变卖，所得收入用于捐赠目的。 </p><p class="rules"><strong>第三十二条</strong> 本基金会财产主要用于: </p><p class="rules">(一) 开展本基金会业务范围内公益活动支出。 </p><p class="rules">(二) 本基金会人员工资福利、日常管理等基金会正常运营费用 </p><p class="rules"><strong>第三十三条</strong> 本基金会的重大募捐、投资活动是指: </p><p class="rules">(一) 本基金会的重大募捐活动是指一次性100万元人民币以上的定向募捐活动； </p><p class="rules">(二) 重大投资活动是指一次性使用100万元人民币以上的投资活动。 </p><p class="rules"><strong>第三十四条</strong> 本基金会按照合法、安全、有效的原则实现基金的保值、增值。 </p><p class="rules"><strong>第三十五条</strong> 本基金会每年用于从事章程规定的公益事业支出，不得低于上一年基金余额的8% 本基金会工作人员工资福利和行政办公支出不超过当年总支出的10% 。</p><p class="rules"><strong>第三十六条</strong> 本基金会开展公益资助项目，应当向社会公开所开展的公益资助项目种类以及申请、评审程序。</p><p class="rules"><strong>第三十七条</strong> 捐赠人有权向本基金会查询捐赠财产的使用、管理情况，并提出意见和建议。对于捐赠 人的查询，基金会应当及时如实答复。</p><p class="rules">本基金会违反捐赠协议使用捐赠财产的，捐赠人有权要求基金会遵守捐赠协议或者向人民法院申请撤销捐赠行为、解除捐赠协议。</p><p class="rules"><strong>第三十八条</strong> 本基金会可以与受助人签订协议，约定资助方式、资助数额以及资金用途和使用方式。</p><p class="rules">本基金会有权对资助的使用情况进行监督。受助人未按协议约定使用资助或者有其他违反协议情形的，本基金会有权解除资助协议。</p><p class="rules"><strong>第三十九条</strong> 本基金会应当执行国家统一的会计制度，依法进行会计核算、建立健全内部会计监督制度，保证会计资料合法、真实、准确、完整。</p><p class="rules">本基金会接受税务、会计主管部门依法实施的税务监督和会计监督。</p><p class="rules"><strong>第四十条</strong> 本基金会配备具有专业资格的会计人员。会计不得兼出纳。会计人员调动工作或离职时，必须与接管人员办清交接手续。</p><p class="rules"><strong>第四十一条</strong> 本基金会每年1月1日至12月31日为业务及会计年度，每年3月31日前，理事会对下列事项进行审定:</p><p class="rules">(一) 上报告及费收算；</p><p class="rules">(二) 本务划经费收支预算；</p><p class="rules">(三) 财产清册。</p><p class="rules"><strong>第四十二条</strong> 本基金会进行年检、换届、更换法定代表人以及清算，应当进行财务审计。</p><p class="rules"><strong>第四十三条</strong> 本基金会按照《基金会管理条例》规定接受登记管理机关组织的年度检查。</p><p class="rules"><strong>第四十四条</strong> 本基金会通过登记管理机关的年度检查后，向捐赠人公布并接受查询、监督。</p><p class="rules"><strong>第四十五条</strong> 本基金会应当合理设计慈善项目，符合本基金会宗旨和章程的有关规定。优化实施流程降低运行成本，提高慈善财产使用效益。</p><p class="rules">本基金会建立健全慈善项目的决策、执行、监督机制，对慈善项目的立项、审查、执行、控制、评估、反馈等环节建立科学、规范、有效的要求，设立项目管理机构，配备专职人员，行使项目管理职责。</p><p class="rules">本基金会按照公开、公平、公正的原则，确定慈善受益人。本基金会管理人员的利害关系人不得作为受益人。</p><p class="rules">本基金会开展重大慈善项目，应当由理事会表决通过，且同意的人数不得低于到会理事人数的2/3。</p><p class="rules">本基金会的重大慈善项目包括：</p><p class="rules">(一) 年度慈善项目计划；</p><p class="rules">(二) 超过10万元的慈善项目； 本基金会开展重大慈善项目之前，应当及时向党建工作机构报备。 项目资金的使用要严格遵守国家财务会计制度的规定，按照捐赠协议专款专用。慈善项目资金的管理使用要自觉接受财政部门、审计机关、党建工作机构、登记管理机关的监督。 本基金会要加强慈善项目档案管理，保存慈善项目的完整信息，做好慈善项目的建档归档工作。</p><p class="rules-para">第五章 终止和剩余财产处理 </p><p class="rules"><strong>第四十六条</strong> 本基金会有以下情形之一，应当终止</p><p class="rules">(一) 完成章程规定的宗旨的； </p><p class="rules">(二) 无法按照章程规定的宗旨继续从事公益活动的 </p><p class="rules">(三) 基金会发生分立、合并的。 </p><p class="rules"><strong>第四十七条</strong> 本基金会终止，应在理事会表决通过后15日内，报党建工作机构审查同意。经党建工作机构审查同意后15日内，向登记管理机关申请注销登记。 </p><p class="rules"><strong>第四十八条</strong> 本基金会办理注销登记前，应当在登记管理机关、党建工作机构的指导下成立清算组织完成清算工作。 </p><p class="rules">本基金会应当自清算结束之日起15日内向登记管理机关办理注销登记；在清算期间不开展清算以外的活动。 </p><p class="rules"><strong>第四十九条</strong> 本基金会注销后的剩余财产，应当在党建工作机构和登记管理机关的监督下，通过以下方式用于公益目的: </p><p class="rules">(一) 捐赠给业务范围相关的非盈利组织；</p><p class="rules">(二) 无法按照上述方式处理的，由党建工作机构和登记管理机关组织捐赠给与本基金会性质、宗旨类同的公益慈善组织，并向社会公告。 </p><p class="rules-para">第六章 章程修改 </p><p class="rules"><strong>第五十条</strong> 本章程的修改，须经理事会表决通过后15日内，报党建工作机构审查同意。经党建工作机构同意后，报登记管理机关核准。 </p><p class="rules-para">第七章 党组织建设 </p><p class="rules"><strong>第五十一条</strong> 本基金会按照党章规定，经上级党组织批准设立党组织。如暂不能单独建立党组织，支持通过联合建立党组织、选派党建工作联络员等方式，在本组织开展党的工作。 </p><p class="rules"><strong>第五十二条</strong> 本基金会如需独立成立党支部，须经上级党组织批准，党组织负责人一般由本基金会秘书长以上负责人中的中共正式党员担任，如需要由其他同志担任的，报党建工作机构审核同意。</p><p class="rules"><strong>第五十三条</strong> 探索建立开放式党组织和党小组，对党员有3名以上，但能接转组织关系的党员不足3名的.建立功能型、拓展型党组织。 </p><p class="rules"><strong>第五十四条</strong> 本基金会换届选举时，应先征求本基金会党组织意见:</p><p class="rules">本基金会变更、撤并或注销，党组织应及时向上级党组织报告，并做好党员组织关系转移等相关工作。 </p><p class="rules"><strong>第五十五条</strong> 本基金会为党组织开展活动、做好工作提供必要的场地、人员和经费支持，将党建工作经费纳入管理费用列支.支持党组织建设活动阵地。 </p><p class="rules"><strong>第五十六条</strong> 本基金会支持领导班子与党组织领导班子双向进入、交叉任职”党组织负责人参加或列席管理层有关会议、党组织开展有关活动邀请非党员的社会组织负责人参加。 </p><p class="rules"><strong>第五十七条</strong> 本基金会支持党组织对本基金会重要事项决策、重要业务活动、大额经费开支、接收大额捐赠、开展涉外活动等提出意见。</p><p class="rules-para">第八章 附 则 </p><p class="rules"><strong>第五十八条</strong> 本章程经2022年9月26日理事会表决通过。 </p><p class="rules"><strong>第五十九条</strong> 本章程的解释权属于理事会。 </p><p class="rules"><strong>第六十条</strong> 本章程自登记管理机关核准之日起生效。</p><p class="rules-date">2022-11-03 09:38:51</p></div>',2),F=[A];function L(t,a){return s(),e("div",j,F)}const D=_(S,[["render",L]]);const E={},T={class:"container-org"},U=d('<h2 class="title">基金会组织</h2><div><p class="item">一、基本情况</p><p class="detail">浙江中有慈善基金会（简称“中有善金”）成立于2022年11月1日，注册资金200万元。中有善金是浙江省民政厅批准成立的慈善组织，业务主管单位为浙江省民政厅。</p><p class="detail">中有善金在公益项目募捐、项目执行等方面制定了完善的规章制度，每年邀请第三方会计师事务所做财务审计和专项审计。聘请专业财务顾问公司和专业法律顾问。</p><p class="detail">中有善金按要求对基金会章程、基金会制度、年度工作报告、项目募捐、项目执行和财务审计等情况进行全面的信息公开。中有善金发扬传统公益慈善精神，为社会弱势群体，尤其是孤、苦、老、弱、贫、病人群提供帮助和扶持。中有善金的核心理念是：有善念、有善行、有善果、有善报、有善缘。</p><p class="item">二、运营情况</p><p class="detail">中有善金重视平台建设。中有善金实行理事会授权下的秘书长负责制，建立专业化团队，完善内部治理，建立高效的运营机制。目前，中有善金建成了一支七个部门组成的20余人的专业团队。完善自身建设的同时，中有善金还努力成为平台型、枢纽型基金会，利用募捐资质、项目管理的丰富经验、较强的募捐号召力、人数众多的义工队伍等优势，为中小社会组织搭建服务平台，孵化、培育中小社会组织成长。</p><p class="detail">中有善金实行项目化运营。中有善金所有公益支出都通过设立公益项目的方式执行，公益项目的执行经过前期调研、项目立项、募捐筹款、项目执行、项目评估和项目结项等环节。公益项目各个环节都按照设立的流程审核，每三个月在指定公开平台进行至少一次信息公开，每年通过第三方会计师事务所进行财务审计，并对募捐收入和公益支出做专项审计，重大项目按审计部门要求做专项审计，审计报告报主管部门和登记机关，并在指定平台公示，接受社会监督。中有善金根据社会的现实需求设立公益项目。</p><p class="detail">中有善金将积极参与重大自然灾害和突发公共安全事件的救助。</p><p class="detail">中有善金计划积极建设分支机构。中有善金扎根杭州，立足浙江，面向全国开展公益慈善事业，将在温州、北京、深圳和上海等地建立工作站，指导孵化各地社会组织和义工团队，在社区和乡村建立中有善缘会书坊，落地执行中有善金计划。</p></div>',2),q=[U];function G(t,a){return s(),e("div",T,q)}const H=_(E,[["render",G]]);const J={class:"container-about wrapper"},K={class:"path"},M=p("span",{class:"your"},"您的位置",-1),Q={class:"path-lv3"},W={class:"content"},X={class:"navigation"},Y={class:"subpage"},as={__name:"About",setup(t){const a=x(),c={1:"基金会介绍",2:"基金会章程",3:"组织架构"},f=l=>a.path.substring(0,a.path.lastIndexOf("/"))+"/"+l;return(l,Z)=>{const o=N("router-link");return s(),e(m,null,[r(b),r(k,{topImg:"/src/assets/images/about.jpg",title:"上善若谁",subPages:c}),p("div",J,[p("div",K,[M,r(o,{to:"/home",class:"path-lv1"},{default:n(()=>[i("首页")]),_:1}),r(o,{to:"/about",class:"path-lv2"},{default:n(()=>[i("上善若谁")]),_:1}),p("span",Q,v(c[l.$route.params.subpage]),1)]),p("div",W,[p("div",X,[(s(),e(m,null,V(c,($,h,ss)=>r(o,{to:f(h),class:w(["nav-item",[{"is-active":l.$route.params.subpage===h}]])},{default:n(()=>[i(v($),1)]),_:2},1032,["to","class"])),64))]),p("div",Y,[l.$route.params.subpage==1?(s(),u(P,{key:0})):g("",!0),l.$route.params.subpage==2?(s(),u(D,{key:1})):g("",!0),l.$route.params.subpage==3?(s(),u(H,{key:2})):g("",!0)])])]),r(y)],64)}}};export{as as default};
